import './App.css';
import logo from './s.png';

function Onglet(){
  return(
    <>
      <nav>
        <ul>
          <li><a href="Accueil.js">Accueil</a></li>
          <li><a href="Blog.js">Blog</a></li>
          <li><a href="Messages.js">Messages</a></li>
          <li><a href="COntacts.js">Contacts</a></li>
        </ul>
      </nav>
    </>
  );
}

function Fond(){
  return(
    <div className='fond'></div>
  );
}

function List(){
  const numbers = [1, 2, 3, 4, 5];
  const listItems = numbers.map((number) =>
    <li key={number.toString()}>
      {number}
    </li>
  );
  return(
    <ul>{listItems}</ul>
  );
}

export default function App(){
  return (
    <>
      <Onglet />
      <Fond />
      <h1>Hello world!</h1>
      <img 
        src={logo}
        alt='logo charcuterie'
        width={150}
        height={150}
      />
      <List />
    </>
  );
}
